// Obtiene el string ISO 8601 de la fecha de asignación desde el input del nodo
// Asegúrate que el nodo anterior (Supabase Get) sí esté pasando esta columna.
const fechaStrISO = $('Supabase Get lista de todos los usuarios').item.json.fechaAsignacionAsesor;
let vencida = false;
let asignDate = null;

if (fechaStrISO) {
  try {
    // new Date() parsea strings ISO 8601 de forma nativa y confiable
    asignDate = new Date(fechaStrISO);
  } catch (e) {
    console.error("Error parsing ISO date string:", fechaStrISO, e);
    asignDate = null; // Falló el parseo
  }
}

// Validar si la fecha es válida (no null y no "Invalid Date")
if (asignDate && !isNaN(asignDate.getTime())) {
  // La lógica de comparación funciona igual (compara timestamps UTC)
  // Se calcula el timestamp de hace 1 hora en UTC
  const oneHourInMilliseconds = 1 * 60 * 59 * 1000;
  const twoHoursAgo = Date.now() - oneHourInMilliseconds; // UTC timestamp 1h ago

  // Compara si la fecha de asignación es anterior a "hace 2 horas"
  vencida = asignDate.getTime() < twoHoursAgo; // Comparación UTC correcta
} else if (fechaStrISO) {
  // Si había fechaStr pero no se pudo parsear o crear, loguear
  console.log("Fecha de asignación inválida o no parseable:", fechaStrISO);
  // Decide si 'vencida' debe ser true/false por defecto en este caso. False es más seguro.
  vencida = false;
} else {
  // No había fecha de asignación
  console.log("No se encontró fecha de asignación para verificar vencimiento.");
  vencida = false; // O el valor que consideres apropiado
}

// devuelve solo { vencida }
return {
  json: { vencida }
};
